import Vue from 'vue';
import Router from 'vue-router';
import Createpart from './views/Createpart.vue';


Vue.use(Router);

export default new Router({
  routes: [

    {
      path: '/create',
      name: 'Createpart',
      component: Createpart,
    },
  ],
});
